import React, { useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import { ThemeProvider ,Typography} from "@material-ui/core";

import * as Constants from "../../../constants";
import { Link } from "react-router-dom";
import { myTheme } from "../../../theme";
const useStyles = makeStyles((theme) => ({
  styleHeader: {
    outline: "none",
    display: "flex",
    justifyContent: "center",

    height: "70px",
    backgroundColor: myTheme.palette.primary.main,
    //backgroundColor: "#3a456b",

  },
  styleLink: {
    textTransform: "none",
  },
}));

const Header = () => {
  const classes = useStyles();
  return (
    <>
      <div className={classes.styleHeader}>
        <Link to="/" className={classes.styleLink}>
          <Typography >{Constants.HOME}</Typography>
        </Link>

        <Link to="/gallery" className={classes.link}>
        <Typography >{Constants.GALLERY}</Typography>
        </Link>
        <Link to="/contact" className={classes.link}>
        <Typography >{Constants.CONTACT}</Typography>
        </Link>
        <Link to="/about" className={classes.link}>
        <Typography >{Constants.ABOUT}</Typography>
        </Link>
        <Link to="/gallery-admin" className={classes.link}>
          <HeaderElement text={Constants.GALLERY_ADMIN}></HeaderElement>
        </Link>
      </div>
    </>
  );
};

export default Header;
